const ABC = getABC();
let PWD = localStorage.getItem('pwd') || '';

document.querySelector('strong').addEventListener('click', function (){
	let h1 = document.querySelector('h1');
	let tools = document.getElementById('tools');
	let em = h1.querySelector('em');
	if (em) {
		em.remove();
		tools.classList.remove('active');
		return;
	}
	tools.classList.add('active');
	em = document.createElement('em');
	h1.appendChild(em);
	em.innerHTML = ' pwd: <input value="' + PWD + '">';
	em.querySelector('input').addEventListener('input', function (){ PWD = this.value || ''; localStorage.setItem('pwd', PWD); });
});

document.getElementById('re').addEventListener('change', convert);
document.getElementById('rd').addEventListener('change', convert);
document.getElementById('ss').addEventListener('input', convert);
document.getElementById('ls').addEventListener('input', convert);

let sBox = document.getElementById('s');

if (PWD) {
	sBox.classList.add('active');
	sBox.querySelector('span').innerText = S.length;
	sBox.querySelector('button').addEventListener('click', function (){
		let html = '\n';
		for (let i = 0; i < 5; i++)
			html += '<p>' + (i + 1) + '. ' + decode(S[Math.floor(Math.random() * S.length)]) + '</p>\n';
		sBox.querySelector('section').innerHTML = html;
	});
}


function getABC(){
	// alphabet with 64 symbols /[%#0-9A-Za-z]/
	let res = '%#';
	for (let i = 0; i < 10; i++) res += String.fromCharCode(48 + i);
	for (let i = 0; i < 26; i++) res += String.fromCharCode(65 + i);
	for (let i = 0; i < 26; i++) res += String.fromCharCode(97 + i);
	return res;
}

function encode(str){
	let res = '', n = str.length, c, c1, c2;
	for (let i = 0; i < n; i++) {
		c = str.charCodeAt(i) ^ PWD.charCodeAt(i % PWD.length);
		c1 = Math.floor(c / 64) % 64;
		c2 = c % 64;
		res += ABC[c1] + ABC[c2];
	}
	return res;
}

function decode(str){
	let res = '', n = str.length, c;
	if (n % 2 !== 0){
		alert('Error #792');
		return '';
	}
	for (let i = 0; i < n; i += 2) {
		c = ABC.indexOf(str[i]) * 64 + ABC.indexOf(str[i + 1]);
		res += String.fromCharCode(c ^ PWD.charCodeAt(Math.floor(i / 2) % PWD.length));
	}
	return res;
}

function convert(){
	let needEncode = document.getElementById('re').checked;
	let ss = document.getElementById('ss');
	let sr = document.getElementById('sr')
	let ls = document.getElementById('ls');
	let lr = document.getElementById('lr');
	sr.value = '';
	lr.value = '';
	if (!PWD) return;
	sr.value = needEncode ? encode(ss.value) : decode(ss.value);
	if (ls.value) {
		lr.value = ls.value.split(',\n').map(function (s){
			s = s.trim();
			if (s[s.length - 1] === ',') s = s.substr(0, s.length - 1);
			s = s.substr(1, s.length - 2);
			return '"' + (needEncode ? encode(s) : decode(s)) + '"';
		}).join(',\n');
	}
}

})();
</script>
